pragma solidity ^0.4.20;

contract VolunteerBlock {

    struct VolunteerStruct {
        bytes32 dimension;
        uint metric;
        uint index;
    }

    mapping(address => VolunteerStruct) private VolunteerStructs;
    address[] private VolunteerIndex;

    event LogNewVolunteer(address indexed volunteerAddress, uint index, bytes32 dimension, uint metric);
    event LogUpdateVolunteer(address indexed volunteerAddress, uint index, bytes32 dimension, uint metric);

    function isVolunteer(address volunteerAddress)
    public 
    view
    returns(bool isIndeed) 
    {
        if(VolunteerIndex.length == 0) return false;
        return (VolunteerIndex[VolunteerStructs[volunteerAddress].index] == volunteerAddress);
    }

    function insertVolunteer(
        address volunteerAddress, 
        bytes32 dimension, 
        uint    metric) 
        public
        returns(uint index)
    {
        if(isVolunteer(volunteerAddress)) revert(); 
        VolunteerStructs[volunteerAddress].dimension = dimension;
        VolunteerStructs[volunteerAddress].metric = metric;
        VolunteerStructs[volunteerAddress].index = VolunteerIndex.push(volunteerAddress)-1;
        emit LogNewVolunteer(
            volunteerAddress, 
            VolunteerStructs[volunteerAddress].index, 
            dimension, 
            metric);
        return VolunteerIndex.length-1;
    }

    function getVolunteer(address volunteerAddress)
        public 
        view
        returns(bytes32 dimension, uint metric, uint index)
    {
        if(!isVolunteer(volunteerAddress)) revert(); 
        return(
            VolunteerStructs[volunteerAddress].dimension, 
            VolunteerStructs[volunteerAddress].metric, 
            VolunteerStructs[volunteerAddress].index);
    } 

    function updateDimension(address volunteerAddress, bytes32 dimension) 
    public
    returns(bool success) 
    {
        if(!isVolunteer(volunteerAddress)) revert(); 
        VolunteerStructs[volunteerAddress].dimension = dimension;
        emit LogUpdateVolunteer(
            volunteerAddress, 
            VolunteerStructs[volunteerAddress].index,
            dimension, 
            VolunteerStructs[volunteerAddress].metric);
        return true;
    }

    function updateMetric(address volunteerAddress, uint metric) 
    public
    returns(bool success) 
    {
        if(!isVolunteer(volunteerAddress)) revert(); 
        VolunteerStructs[volunteerAddress].metric = VolunteerStructs[volunteerAddress].metric + metric;
        emit LogUpdateVolunteer(
            volunteerAddress, 
            VolunteerStructs[volunteerAddress].index,
            VolunteerStructs[volunteerAddress].dimension, 
            metric);
        return true;
    }

    function getUserCount() 
    public
    view
    returns(uint count)
    {
        return VolunteerIndex.length;
    }

    function getUserAtIndex(uint index)
    public
    view
    returns(address volunteerAddress)
    {
        return VolunteerIndex[index];
    }

}
